contracts/transactions.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Transactions {
    IERC20 public cbdcToken;
    address public systemContract;
    string public contractPeriod; // "morning" or "afternoon"

    struct Transaction {
        address payor;
        address recipient;
        uint256 amount;
        string creationPeriod;
        string settlementPeriod;
        bool isOpen;
        bool isCancelled;
    }

    Transaction[] public transactions;

    event TransactionCreated(uint256 indexed transactionId, address indexed payor, address indexed recipient, uint256 amount, string creationPeriod);
    event TransactionSettled(uint256 indexed transactionId, string settlementPeriod);
    event TransactionCancelled(uint256 indexed transactionId);

    constructor(address _cbdcTokenAddress, address _systemContract, string memory _contractPeriod) {
        require(isValidPeriod(_contractPeriod), "Invalid contract period");
        cbdcToken = IERC20(_cbdcTokenAddress);
        systemContract = _systemContract;
        contractPeriod = _contractPeriod;
    }

    function createTransaction(address _recipient, uint256 _amount) public {
        uint256 transactionId = transactions.length;
        transactions.push(Transaction({
            payor: msg.sender,
            recipient: _recipient,
            amount: _amount,
            creationPeriod: contractPeriod,
            settlementPeriod: "",
            isOpen: true,
            isCancelled: false
        }));

        require(cbdcToken.transferFrom(msg.sender, address(this), _amount), "Transfer failed");

        emit TransactionCreated(transactionId, msg.sender, _recipient, _amount, contractPeriod);
    }

    function settleTransaction(uint256 _transactionId, string memory _settlementPeriod) public {
        require(msg.sender == systemContract, "Only the system contract can settle transactions.");
        Transaction storage transaction = transactions[_transactionId];

        require(transaction.isOpen, "Transaction is already settled or cancelled.");
        require(isValidPeriod(_settlementPeriod), "Invalid settlement period");
        require(isValidSettlementPeriod(transaction.creationPeriod, _settlementPeriod), "Settlement period invalid for the given creation period");

        transaction.isOpen = false;
        transaction.settlementPeriod = _settlementPeriod;
        require(cbdcToken.transfer(transaction.recipient, transaction.amount), "Transfer failed");

        emit TransactionSettled(_transactionId, _settlementPeriod);
    }

    function cancelTransaction(uint256 _transactionId) public {
        Transaction storage transaction = transactions[_transactionId];

        require(msg.sender == transaction.payor, "Only the payor can cancel the transaction.");
        require(transaction.isOpen, "Transaction is already settled or cancelled.");
        transaction.isOpen = false;
        transaction.isCancelled = true;
        require(cbdcToken.transfer(transaction.payor, transaction.amount), "Refund failed");

        emit TransactionCancelled(_transactionId);
    }

    function getTransaction(uint256 _transactionId) public view returns (address, address, uint256, string memory, string memory, bool, bool) {
        Transaction memory transaction = transactions[_transactionId];
        return (transaction.payor, transaction.recipient, transaction.amount, transaction.creationPeriod, transaction.settlementPeriod, transaction.isOpen, transaction.isCancelled);
    }

    function isValidPeriod(string memory period) private pure returns (bool) {
        return (keccak256(abi.encodePacked((period))) == keccak256(abi.encodePacked(("morning"))) || keccak256(abi.encodePacked((period))) == keccak256(abi.encodePacked(("afternoon"))));
    }

    function isValidSettlementPeriod(string memory creationPeriod, string memory settlementPeriod) private pure returns (bool) {
        if (keccak256(abi.encodePacked((creationPeriod))) == keccak256(abi.encodePacked(("afternoon"))) && keccak256(abi.encodePacked((settlementPeriod))) == keccak256(abi.encodePacked(("morning")))) {
            return false;
        }
        return true;
    }

    // Placeholder function for loading the contract into the systemContract
    function loadIntoSystemContract() public {
        // Implementation will be defined in the systemContract
    }
}

